import React from "react";

const Banner = () => {
  return (
    <div className="banner-container">
      <div className="text-banner">Chez vous, partout et ailleurs</div>
      <img className="banner" src="./banner.png" alt="banner" />
    </div>
  );
};

export default Banner;
